    [],nt"num_tags": 5,nt"name": "mason-neck-national-wildlife-refuge-annual-narrative-report-calendar-year-1989",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Mason
    Neck National Wildlife Refuge outlines Refuge accomplishments during the 1989 calendar
    year. The report begins with an introduction to the Refuge and information about
    climate conditions and land acquisition. The planning section discusses the management
    plan, public participation, compliance with environmental and cultural resource
    mandates, and research and investigations. Administration topics are covered; topics
    include personnel, volunteer programs, funding, safety, and technical assistance.
    Habitat management is covered; wetlands, forests, grasslands, fire management, and
    pest control are discussed. The wildlife section of the report discusses wildlife
    diversity, endangered and threatened species, waterfowl, marsh and water birds,
    shorebirds, raptors, game mammals, other resident wildlife, scientific collections,
    and marking and banding. Interpretation and recreation activities are outlined;
    topics include outdoor classrooms, information and interpretation, wildlife observation,
    other non-wildlife oriented recreation, and law enforcement. The equipment and facilities
    section discusses new construction, rehabilitation, equipment utilization and replacement,
    computer systems, and energy conservation. Cooperative programs and items of interest
    are discussed. Brief narratives for Marumsco National Wildlife Refuge and Featherstone
    National Wildlife Refuge are included. Photographs and brochures are attached.",nt"owner_org":
